function createRequestAdm(){try{requestAdm=new XMLHttpRequest}catch(e){try{requestAdm=new ActiveXObject("Msxml2.XMLHTTP")}catch(e){try{requestAdm=new ActiveXObject("Microsoft.XMLHTTP")}catch(e){requestAdm=null}}}null==requestAdm&&console.log("Error creating request object!")}function atualizaPaginaAdm(){if(4==requestAdm.readyState&&200==requestAdm.status){var e=JSON.parse(requestAdm.responseText);$("#name").val(e.adm.name),$("#cpf").val(e.adm.cpf),$("#cargo").val(e.adm.cargo),$("#email_adminstrador").val(e.adm.email)}}function buscarAdm(){createRequestAdm();var e=$("#adm_id").val();requestAdm.open("GET",url+e,!0),requestAdm.onreadystatechange=atualizaPaginaAdm,requestAdm.send(null)}var requestAdm=null;